// React
import React from "react";

// Third part
import { Table } from "antd";

const { Column } = Table;

const Tables = ({ colOne, colTwo, colThird }) => {
  return (
    <Table>
      <Column title={colOne}></Column>
      <Column title={colTwo}></Column>
      <Column title={colThird}></Column>
    </Table>
  );
};

export default Tables;
